import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";

const Patient = () => {
  const [patientName, SetPatientName] = useState("");
  const [patientSurname, SetPatientSurname] = useState("");
  const [patientPesel, SetPatientPesel] = useState("");
  const [patientCity, SetPatientCity] = useState("");
  const [patientStreet, SetPatientStreet] = useState("");
  const [patientHouseNumber, SetPatientHouseNumber] = useState("");
  const [patientGender, SetPatientGender] = useState("");
  const [patientDateOfBirth, SetPatientDateOfBirth] = useState("");

  return (
    <div className="App">
      <div className="inputsWrapper">
        <div class="form__group field">
          <input
            placeholder="Opis stosowania"
            required
            class="form__field"
            type="text"
            name="patient_name"
            onChange={(e) => {
              SetPatientName(e.target.value);
            }}
          />
          <label class="form__label">Imię</label>
        </div>
        <div class="form__group field">
          <input
            placeholder="Opis stosowania"
            required
            class="form__field"
            type="text"
            name="patient_surname"
            onChange={(e) => {
              SetPatientSurname(e.target.value);
            }}
          />
          <label class="form__label">Nazwisko</label>
        </div>
        <div class="form__group field">
          <input
            placeholder="Opis stosowania"
            required
            class="form__field"
            type="text"
            name="patient_pesel"
            onChange={(e) => {
              SetPatientPesel(e.target.value);
            }}
          />
          <label class="form__label">Pesel</label>
        </div>
        <div class="form__group field">
          <input
            placeholder="Opis stosowania"
            required
            class="form__field"
            type="text"
            name="patient_city"
            onChange={(e) => {
              SetPatientCity(e.target.value);
            }}
          />
          <label class="form__label">Miasto</label>
        </div>
        <div class="form__group field">
          <input
            placeholder="Opis stosowania"
            required
            class="form__field"
            type="text"
            name="patient_street"
            onChange={(e) => {
              SetPatientStreet(e.target.value);
            }}
          />
          <label class="form__label">Ulica</label>
        </div>
        <div class="form__group field">
          <input
            placeholder="Opis stosowania"
            required
            class="form__field"
            type="text"
            name="patient_house_number"
            onChange={(e) => {
              SetPatientHouseNumber(e.target.value);
            }}
          />
          <label class="form__label">Numer domu</label>
        </div>
        <div>
          <label>Płeć</label>
          <input
            type="text"
            name="patient_gender"
            onChange={(e) => {
              SetPatientGender(e.target.value);
            }}
          />
        </div>
        <div class="form__group field">
        <input
          placeholder="Opis stosowania"
          required
          class="form__field"
            type="date"
            name="patient_date_of_birth"
            onChange={(e) => {
              SetPatientDateOfBirth(e.target.value);
            }}
          />
                  <label class="form__label">Opis stosowania</label>
        </div>
      </div>
    </div>
  );
};

export default Patient;
